import React from 'react';

import { NavLink } from 'react-router-dom';

const Navigation = () => {
    return (
       <div>
          <NavLink to="/">About</NavLink>
          <NavLink to="/contact">Contact</NavLink>
          <NavLink to="/contact">Portfolio</NavLink>
       </div>
    );
}

export default Navigation;
